INSERT INTO `stock_orders` VALUES (1,'1. Servotech Power Systems Ltd\r\n\r\nProducts\r\nThe Co‚Äôs product portfolio includes Medical Grade Oxygen Concentrator, UV-C, Solar Products, Solar Power, PV Port, Commercial LEDs- street light, flood light, Flam Proof, Hi-Bay Light, canopy light and tube light.\r\n\r\nClients\r\nSome of the clients of the co include Indian oil, Bharat petroleum, HP, Gail, AU Small Finance Bank, Hindware and a lot more\r\n\r\nPROS\r\nCompany is expected to give good quarter\r\nCompany has delivered good profit growth of 21.8% CAGR over last 5 years\r\nCompany\'s median sales growth is 29.9% of last 10 years\r\n\r\ndividend of 0.52 promoter holding of 60% also good fundamental data',1,'2023-08-18 11:07:26','2023-08-31 02:27:48'),(2,'2. Ashok Alco-Chem Ltd\r\nProducts and Application:\r\nThe company\'s products are under three divisions:\r\na) Chemical Division:[1]\r\nThis consists of three main products viz.,\r\nEthyl Acetate: It is used in a variety of coating formulations\r\nGlacial Acetic Acid: It is used in paint, varnish, lacquer and related products\r\nAcetaldehyde: It is used as an intermediate for the synthesis of other chemicals\r\n\r\nb) Ceramic Material Division:[2]\r\nThis consists of three main products viz.,\r\nBall Clays: It is used in many different industries, but in particular form a vital component in ceramic manufacturing\r\nQuartz: It is used as a gemstone and in electronic applications\r\nFeldspar: It is used in making the body composition of several types of porcelain, china and earthenware and also in the preparation of glazes and enamel. It is also used as an ingredient in glass sand batch and as a bonding agent in the manufacture of bonded abrasives\r\n\r\nGlobal Trading Division:[3]\r\nThe company also commenced trading in some mineral products mainly for exports like:\r\nCore Minerals: Bauxite, Bentonite and Kaolin\r\nOther Minerals: Gypsum, Bleaching Earth and Iron Ore.\r\n\r\nCompany also gives 0.4% dividend and promoter holding is 55%\r\n\r\nPROS\r\n\r\nCompany has reduced debt.\r\nCompany is almost debt free.\r\nStock is trading at 1.16 times its book value\r\nCompany is expected to give good quarter\r\nMy view\r\n1. The products are the raw materials of paint and other materials. Quarts are used for electronics. So company \r\nmust have a good growth',1,'2023-08-19 10:41:39','2023-08-31 02:28:04'),(3,'3. Vikas Life Care - NOW I HAVE 200 STAKES THAT IS ENOUGH. Don\'t make more investment due to promoter holding is only 11.4%.\r\n\r\nUser Industries:[3]\r\nAutomotive Components, Footwear, Electricals, Hygiene & Healthcare, Agri Products, Chemical Components\r\n\r\nClientele:[4]\r\nHorizon Global Ltd, Relaxo, Zara, Bata, Polycab, Havells, KEI, Biotique, Escorts, Nimbark, Navratan, GAIl, Gujarat Gas, etc.\r\n\r\nBusiness Segments:[2]\r\nCompany deals in various business segments including Polymer & Rubber Commodity (bulk consumption) Compounds and Master-Batches, manufacturing Up-Cycled Compounds from industrial and post-consumer waste and scrap materials like EVA, PVC, PP, PE etc. Company is also a Del-Credere agent of ONGC Petro Additions Limited, a public sector undertaking producing a variety of base polymers and commodity plastic raw materials. In addition, the company has a division engaged in Agro Products Business, and is empanelled with NAFED ‚Äì The ‚ÄúNational Agricultural Co Operative Federation of India‚Äù and HOFED ‚Äì The ‚ÄúUttar Pradesh Horticultural Co Operative Marketing Federation‚Äù. At present, company has diversified it‚Äôs business interests beyond raw materials (B2B businesses) and forayed into the B2C segment with a host of consumer products for FMCG, Agro, and Infrastructure Segments\r\n\r\nFuture Outlook[20]\r\nCo. plans to start various activities including Food and Crop Protection, Food and Crop Preservation and Storage, for developing and using modern techniques and facilities for cultivation like Green Houses, Glass Structures, Micro Irrigation, Hydroponics, etc.',1,'2023-08-31 02:21:27','2023-08-31 02:27:26'),(4,'4. RUBFILA\r\n\r\nMalaysia along with Kerala State Industrial Development Corporation (KSIDC) \r\nmanufacturing of both Talcum Coated and Silicon Coated Heat Resistant Rubber threads \r\n\r\nRevenue Breakup\r\nIndia - 79%\r\nAsia - 14%\r\nEurope - 1%\r\nAmerica - 6%\r\n\r\nLow debt good dividend and promoter holding is 57%\r\nThese company products is used for almost all fields like automobile, aircraft, health, mattresses etc',1,'2023-08-31 02:28:06','2023-08-31 02:44:08'),(5,'RBA Restuarant Brands Asia Study before do further investment\r\n\r\nhas established ~260 restaurants across major cities. The company is an Exclusive National Master Franchisee of Burger King in India and its subsidiaries are Exclusive National Master Franchisee of the brands Burger King and Popeyes in Indonesia\r\n\r\nProduct Offerings\r\nCompany provides variety across its food offerings, which include burgers, wraps, beverages, sides, snacks, shakes, desserts, etc.\r\n\r\ncompany gives good quarter but fundamentally week. because they developing their business',1,'2023-08-31 02:45:26','2023-08-31 02:48:45'),(6,'5. Suraj Ltd - study before invest\r\n\r\nSeamless Heat Exchanger Tubes, and Seamless Heat Exchanger. \'U\'-Tubes, Seamless Instrumentation Tubes, Welded & Seamless Mechanical Polished Tubes, Welded & Seamless Electropolished Tubes, Seamless Pipes, Seamless Buttweld Fittings, Flanges & Stub Ends, and Forged Rings.\r\n\r\nClientele\r\nThe company‚Äôs end users include Samsung, Maersk, NTPC, ONGC, TATA group, NMDC etc.\r\n\r\nExports\r\nSuraj Limited is a Govt. of India recognized Export House and is selling its premium products in India and abroad to more than 70 countries all over the world.\r\n\r\nCompany has high debt and not paying any dividend. Promoter holding is 75%',1,'2023-08-31 02:51:41','2023-08-31 02:54:00'),(7,'6. Premierpol study about business before do further investments\r\n\r\nProducts & Usage:[1]\r\nThe Company carries business of the manufacturing of Vinyl Flooring, Sheeting and Leather cloth etc. along with Flexible PVC Flooring, Film and Sheets. The company\'s range of products include PVC Flooring, PVC Sheeting, PVC Flexible Film, Calendared Leather cloth, PVC Geomembrane, High voltage Insulated Mats etc.\r\nThe products of the company are used for a variety of industrial and consumer applications e.g., PVC products, Transport Flooring with Silicon Carbide Flooring for Heavy Traffic application, Artificial Leather, 100% Shock proof insulating Mats for Buses and Cars, PVC Sheeting for Table Covers.\r\n\r\nThe company has a marketing network of 90-100 dealers spread across India and has established relationships with end users such as the railways and other customers. The company exports its products to over 25 countries across the globe\r\n\r\ncompany has low debt and good dividend and promoter holding is 67%',1,'2023-08-31 02:56:17','2023-08-31 02:58:14'),(8,'8. GPPL - invest more if you can\r\n\r\nGujarat Pipavav Port is India\'s first private sector port located on the south west coast of Gujarat near Bhavnagar. The port is strategically placed to on International Maritime Trade route which connects India with US, Europe, Africa, Middle East on one side and Far east on the other side.\r\n\r\npaying high dividend and low debt. Promoter holding is 44%',1,'2023-08-31 02:59:51','2023-08-31 03:03:23'),(9,'9 . Federal Bank',1,'2023-08-31 03:04:42','2023-08-31 03:05:13'),(10,'10. ITC',1,'2023-08-31 03:04:45','2023-08-31 03:05:31'),(11,'11. Nifty bees',1,'2023-08-31 03:04:46','2023-08-31 03:05:50');
